    }

    let DiamondStone = new Diamond(req.body);
    let DiamondPriceGenerator = new PriceGenerator(DiamondStone);
    let price = DiamondPriceGenerator.handle();

    price.then( (p) => {
      res.json({data:{price:p}})
    });
  }
}

